import "./style.css";

const Nav = () => {
  return (
    <nav className="App-nav">
      <div className="App-DivLogo">
        <p className="App-pOne">Nu</p>
        <p className="App-pTwo">Kenzie</p>
      </div>

      <div>
        <button>Inicio</button>
      </div>
    </nav>
  );
};
export default Nav;
